import * as React from "react";
import theme from "./Theme";
import { ThemeProvider } from "@mui/material";
import AppRoutes from "./AppRoutes";
import "./App.css";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <AppRoutes />
      </div>
    </ThemeProvider>
  );
}

export default App;
